import './App.css';
import Buscador from './containers/Buscador/Buscador';
import Navbar from './components/Navbar/Navbar';
import Sections from './components/Sections/sections';
function App() {
  return (
    <>
    <Navbar/>
    <Buscador/>
    <Sections/>
    </>
  );
}

export default App;
